import React from 'react';
import { motion } from 'framer-motion';

const Dashboard = () => {
  return (
    <motion.div
      initial={{ opacity: 0 }}
      animate={{ opacity: 1 }}
      exit={{ opacity: 0 }}
    >
      <h1 className="gradient-text">Dashboard</h1>
      <p>Welcome to your high-tech weather dashboard. Real-time data and analytics at your fingertips.</p>
    </motion.div>
  );
};

export default Dashboard;
